import React from "react";

const text = [
  { line: "All Offers" },
  { line: "Categories" },
  { line: "Blogs" },
  { line: "Contact Us" },
  { line: "Become a seller"},
  { line: "Get a Quote"},
];

const Label = () => {
  return <div className="inline-flex flex-row space-x-20 justify-center w-full h-auto bg-[#252525] mt-[16px]">
      {text.map((k ,i) => {
          return(
          <div className="text-md text-white" key={i} >{k.line}</div>
           );
          })}
  </div>;
};

export default Label;
